// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import DaisyUINavbar from './DaisyUINavbar';
import Home from './Home'; // Import your Home component
import Syllabus from './Syllabus'; // Import your Syllabus component
import Upload from './Upload'; // Import your Upload component
import ReviewFeedback from './ReviewFeedback'; // Import your ReviewFeedback component

function App() {
  return (
    <Router>
      <div className="App">
        <DaisyUINavbar />
        <Switch>
          <Route path="/home" component={Home} />
          <Route path="/syllabus" component={Syllabus} />
          <Route path="/upload" component={Upload} />
          <Route path="/review-feedback" component={ReviewFeedback} />
          {/* Add more routes as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
